/*
class TreeNode {
    public:
        int data;
        TreeNode* left;
        TreeNode* right;
    
        TreeNode() {
        }
        
        TreeNode(int data) {
            this->data = data;
        }
        
        TreeNode(int data, TreeNode* left, TreeNode* right) {
            this->data = data;
            this->left = left;
            this->right = right;
        }
};
*/

class Solution {
public:
	vector<vector<int>> levelOrder(TreeNode* & root) {
        vector<vector<int>> ans;
		queue<TreeNode*> q;
        q.push(root);

        while(!q.empty()) {
            vector<int> curr_level;
            int number_of_nodes_in_curr_level = q.size();
            for(int i=0;i<number_of_nodes_in_curr_level;i++) {
                TreeNode* curr_node = q.front();
                curr_level.push_back(curr_node->data);
                q.pop();
                if(curr_node->left != nullptr) q.push(curr_node->left);
                if(curr_node->right != nullptr) q.push(curr_node->right);
            }
            ans.push_back(curr_level);
        }
        return ans;
	}
};

const { chromium } = require('playwright');

(async () => {
  // Launch a browser and create a page
  const browser = await chromium.launch();
  const page = await browser.newPage();

  // Define the API endpoint and request data
  const apiEndpoint = 'https://example.com/api/endpoint'; // Replace with your API URL
  const body = {
    key1: 'value1',
    key2: 'value2',
  };

  // Configure the POST request
  const headers = {
    'Content-Type': 'application/json',
  };
  const requestOptions = {
    method: 'POST',
    headers,
    body: JSON.stringify(body),
  };

  // Make the POST request
  const response = await page.goto(apiEndpoint, requestOptions);

  // Check the response status
  if (response.status() >= 200 && response.status()<400) {
    const responseBody = await response.json();
    console.log('Response:', responseBody);
  } else {
    console.error('Failed to make the API request');
  }

  // Close the browser
  await browser.close();
})().catch((error) => console.error(error));

