#include <iostream>

using namespace std;

struct Node {
	int data;
	Node* next;
};

// membuat node stack
Node* top = nullptr;

// fungsi mengecek apakah stack kosong atau tidak
bool isEmpty() {
    return top == nullptr;
}

// fungsi melakukan push ke stack
void push(int value) {
    Node* newNode = new Node;
    newNode->data = value;
    newNode->next = top;
    top = newNode;
}

// fungsi melakukan pop dari stack
void pop() {
    if (isEmpty()) {
        cout << "stack kosong." << endl;
        return;
    }
    Node* temp = top;
    top = top->next;
    delete temp;
}

// fungsi mengembalikan nilai teratas dari stack
int peek() {
    if (isEmpty()) {
        cout << "stack kosong." << endl;
        return -1;
    }
    return top->data;
}

// fungsi mencetak semua nilai yg ada di dalam stack
void display() {
    if (isEmpty()) {
        cout << "stack kosong." << endl;
        return;
    }
    Node* current = top;
    while (current != nullptr) {
        cout << current->data << " ";
        current = current->next;
    }
    cout << endl;
}

int main() {
    push(1);    // push 1
    push(2);    // push 2
    push(3);    // push 3
    push(5);    // push 5
    display();  // menampilkan stack
    pop();      // pop pada top stack
    display();  // menampilkan stack

    if (isEmpty()) {
        cout << "stack kosong!" << endl;
    } else {
        cout << "Elemen teratas pada stack: " << peek() << endl;
    }

    return 0;
}

