double x = 0;
double y = 3.4;
double z = -5.6;
int negativeNumbersCount = 0;

if (x < 0)
{
  negativeNumbersCount++;
}

if (y < 0)
{
  negativeNumbersCount++;
}

if (z < 0)
{
  negativeNumbersCount++;
}

if (x == 0 || y == 0 || z == 0)
{
    Console.WriteLine("0");
}
else
{
  if (negativeNumbersCount % 2 == 0)
  {
        Console.WriteLine("+");
  }
  else
  {
        Console.WriteLine("-");
  }
}

